  [],\n\t\"num_tags\": 0,\n\t\"name\": \"conductivity-water-temperature-and-others-collected-from-r-v-pelican-in-gulf-of-mexico-from-201\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The main goals of this cruise were as follows:
  (1) Recover six moorings, including one sound source, and three trawl resistant
  bottom mounts concentrated in the upper De Soto Canyon. Instruments recovered have
  collected a years worth of: temperature, conductivity, pressure and current data.
  (2) Occupy CTD stations at the mooring locations and along the western edge of De
  Soto Canyon, collecting measurements of: temperature, conductivity, pressure, dissolved
  oxygen, turbidity (amount of suspended particles in the water), optical properties
  of water (transmittance or attenuation of incident radiation), and chlorophyll -A.
  (3) Sample water from the western edge of De Soto Canyon, up to and including mooring
  M6, in order to better understand the cholorophyll max. Collected samples will be
  analyzed for methane concentration, oxygen concentration, nutrients, cell microscopy,
  microbes (for DNA/RNA work) and particulate organic carbon (for carbon isotope work).
  (4) Acquire shipboard ADCP data (75kHz, 150kHz, and 300 kHz), from surface to bottom,
  for the duration of the cruise. This dataset contains CTD data from this cruise.\",\n\t\"owner_org\":
